  <Popup style={{width:"auto"}} trigger={<button>Create an Event</button>} position="right top">
    <form style={pop} onSubmit={events()}>
        Event name:
        <input type="text" required/>
        Event Desc:
        <input type="text" required/>
        From
        <input type="date"/>
        <input type="time"/>
        To
        <input type="date"/>
        <input type="time"/>
        <input type="submit"/>

    </form>
  </Popup>
);
